import React from "react";
import { NavLink } from "react-router-dom";
import "./About.css";

//creo el componente funcional About que se mostrará en la ruta /about
export default function About() {

    return (
        <div>
            <br></br>
            <br></br>
            <h3>Matías Ramira - Full Stack Developer</h3>
            <h4> Soy desarrollador Full Stack con orientación al Back-end y estudiante de ingeniería en informática. Tengo 22 años y vivo en Argentina.</h4>
            <h4> Si te interesa saber más sobre mí, dejo esto por acá: </h4>
            <br></br>
            <a ref="https://www.linkedin.com/in/matiasramira/">
                <h4> Linkedin </h4>
            </a>
            <NavLink to="/">
                <h4> GitHub </h4>
            </NavLink>

        </div>

    )
}
